func GetToken(servicesMap map[string][]string, service string) string {
	strings, exists := servicesMap[service]
	if !exists {
		return ""
	}

	for _, token := range strings {
		if CheckToken(token) {
			return token
		}
	}
	return ""
}

func CheckToken(token string) bool {
	// Create an authenticated GitHub client using the provided token
	ts := oauth2.StaticTokenSource(&oauth2.Token{AccessToken: token})
	tc := oauth2.NewClient(context.Background(), ts)
	client := github.NewClient(tc)

	// Send a request to the GitHub API's rate limit endpoint
	rl, _, err := client.RateLimits(context.Background())
	if err != nil {
		log.Println(err)
		return false // assume rate limit if unable to get rate limit
	}

	// Check if the token is rate limited
	coreLimit := rl.Core.Limit
	coreRemaining := rl.Core.Remaining
	if coreRemaining == 0 {
		log.Printf("API rate limit exceeded. Limit: %d, Remaining: %d\n", coreLimit, coreRemaining)
		return false
	}

	return true
}

